import React from 'react'
import styles from './Modal.module.css'

const Modal = ({ show, setShow, variant, roots }) => {
  const RootCreate = () => {
    return <div>RootCreate</div>
  }

  const RootDelete = () => {
    return <div>RootDelete</div>
  }

  const ChildrenCreate = () => {
    return <div>ChildrenCreate</div>
  }

  const modalVariants = {
    'root-create': <RootCreate />,
    'root-delete': <RootDelete />,
    'children-create': <ChildrenCreate />,
  }

  return <div>{modalVariants[variant]}</div>
}

export default Modal
